import React from 'react';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './Header';
import Login from './Login';
import Register from './Register';
import AddCoachs from './AddCoachs';
import CoachsList from './CoachsList';
import AddRecette from './AddRecette';
import RecetteList from './RecettesList';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/addcoachs" element={<AddCoachs />} /> {/* Corrected path */}
          <Route path="/coachlist" element={<CoachsList />} /> {/* Corrected path */}
          <Route path="/addrecette" element={<AddRecette />} /> {/* Corrected path */}
          <Route path="/recettelist" element={<CoachsList />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
